import React from 'react';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css'; // Импортируем CSS Bootstrap
import './ButtonMap.css'; // Импортируем стили

interface ButtonComponentProps {
  onClick: () => void;
}

const ButtonComponent: React.FC<ButtonComponentProps> = ({ onClick }) => {
  return (
    <Button className="custom-button" variant="primary" onClick={onClick}>
      maps
    </Button>
  );
};

export default ButtonComponent;
